6.17.5	OFO Notice, Contents and Procedures.  Seller shall issue an OFO as expeditiously as is reasonably practicable in the circumstances, utilizing electronic communication, (information transmitted via Seller's Internet Site, electronic delivery mechanism prescribed by NAESB or other mutually agreed communication methodologies used to transmit and receive information, including communication by telephone).  Seller shall post and provide Customers with updated information concerning the status of operational variables related to the OFO as soon as it is available.  Each OFO will contain the following provisions:

(a)	time and date of issuance;

(b)	time that the OFO is considered to be effective (if no time is specified, the OFO shall be effective immediately);

(c)	duration of the OFO (if none is specified, the OFO will be effective until further notice);

(d)	the party or parties receiving the OFO;

(e)	the quantity of Gas required to remedy the operational condition requiring the issuance of the OFO; and

(f)	any other terms Seller may reasonably require to ensure the effectiveness of the OFO.

