6.7	QUALITY

1.	Heat Content.  Heat content shall mean the gross heating value per cubic foot of Gas received or delivered hereunder.  Such Gas shall have a heat content not less than 950 BTU per cubic foot when determined on a dry basis.  Seller shall have the right to waive such BTU content limits if, in Seller's sole opinion, Seller is able to accept Gas with a BTU content outside such limits without affecting Seller's operations.  The total heating value per cubic foot of Gas shall be determined by one of the following methods:

(a)	by means of an instrument of standard manufacture installed to measure the heating value of the Gas.

(b)	at intervals of not more than six (6) Months by means of an instrument of standard manufacture and a sample of Gas from the Gas stream.

(c)	other method mutually agreed upon by both parties.

For the purpose of calculating injections and withdrawals, the heat content of the Gas so determined at each such point shall be deemed to remain constant at such point until the next determination.  The unit of quantity for the purpose of determining total heating value shall be one (1) cubic foot of anhydrous Gas at a temperature of sixty degrees (60) Fahrenheit and an absolute pressure of 14.73 psia, dry.

2.	Freedom from Objectionable Matter.  The Gas injected and withdrawn hereunder:

(a)	shall be commercially free from dust or other solid or liquid matter which might interfere with its merchantability or cause injury to or interference with proper operation of the lines, regulators, meters and other equipment of Seller;

(b)	shall not contain more than one quarter (.25) grain of hydrogen sulfide per one hundred (100) cubic feet of Gas, as determined by methods prescribed in Standards of Gas Service, Circular of the National Bureau of Standards, No. 405, page 134 (1934 edition), and shall be considered free from hydrogen sulfide (H2S) if a strip of white filter paper, moistened with a solution containing five percent (5%) by weight of lead acetate, is not distinctly darker than a second paper freshly moistened with the same solution, after the first paper has been exposed to the Gas for one and one-half (1-1/2) minutes in an apparatus of approved form, through which the Gas is flowing at the rate of approximately five (5) cubic feet per hour, the Gas from the jet not impinging directly upon the test paper; or the H2S content may be determined by an instrument of approved type and by approved methods agreeable to the parties;

(c)	shall not contain more than twenty (20) grains of total sulfur (including the sulfur in any hydrogen sulfide and mercaptans) per one hundred (100) cubic feet of Gas;

(d)	shall not at any time have an oxygen content in excess of one percent (1%) by volume and the parties hereto shall make every reasonable effort to keep the Gas free of oxygen;

(e)	shall not contain as nearly as practicable any free water nor contain more than four (4) pounds of water vapor per million cubic feet of Gas;

(f)	shall not contain more than two percent (2%) by volume of carbon dioxide;

(g)	shall be delivered at a temperature not in excess of one hundred twenty degrees (120) Fahrenheit or less than forty degrees (40) Fahrenheit; 

(h)	shall not contain more than three percent (3%) by volume of nitrogen; and

(i)	shall not contain any polyclorinated biphenyls.

3.	Failure to Meet Specifications.  Should any Gas tendered for injection or withdrawal hereunder fail at any time to conform to any of the specifications of this Article, the affected Party shall notify the other party of any such failure and the affected party may at its option suspend all or a portion of the receipt of any such Gas, and shall be relieved of obligations hereunder for the duration of such time as the Gas does not meet such specifications.

4.	Commingling.  It is recognized that Gas delivered to Seller by Customer will be commingled with other Gas stored hereunder by Seller.  Accordingly, the Gas of Customer shall be subject to such changes in heat content as may result from such commingling and Seller shall, notwithstanding any other provision herein, be under no obligation to withdraw for Customer's account, Gas of a heat content identical to that caused to be delivered by Customer to Seller.

