5.1.8.1.A	Procedure for Making an Offer to Release.  Releasing Customer shall communicate its release notice through Seller's Internet Site.  The Releasing Customer shall submit the following information, objectively stated and applicable to all potential Customers on a non-discriminatory basis:

(1)	the pricing provisions of the offer to release (releases longer than one (1) year are subject to the limits of Seller's Maximum Rate) and whether bids should be denominated in dollars and cents or as a percentage of Maximum Tariff Rate for a non-index-based release, or the index-based formula as detailed in the capacity release offer;

If the release is for a term of one (1) year or less and is to take effect on or before one (1) year from the date on which the Seller is notified of the release, the Deliverability Rate, Capacity Rate, volumetric rate, percentage of the maximum tariff rate, or the rate resulting from the index-based formula as detailed in the capacity release offer for capacity released and assigned may exceed the maximum Deliverability Rate, maximum Capacity Rate or volumetric rate for the service being released.

Payments or other consideration exchanged between the Releasing Customer and Replacement Customer in a release to an asset manager as described in Section 5.1.8.1.F are not subject to the maximum rate.

(2)	the specific quantity to be released expressed in Dth; the basis for released quantity should be per Day for Storage Injection/Withdrawal, and a per-release quantity for Storage capacity and total release period quantity;

(3)	the duration of release or term including any right to recall;

(4)	The terms and conditions of any recall rights.  Releasing Customers may, to the extent permitted as a condition of the capacity release, recall released capacity by providing notice to the Seller in accordance with the time line set forth below (stated in Central Clock Time).  The recall notification shall show the recall quantity expressed in terms of adjusted total released capacity entitlements based upon the Elapsed Prorata Capacity.  Recalled capacity notices will indicate whether penalties will apply for the Gas Day for which quantities are reduced due to a capacity recall.  Seller will support the ability for the Releasing Shipper to specify, as a condition of a release, whether the Releasing Shipper's recall notification must be provided exclusively on a Business Day.  When capacity is recalled, it may not be reput for the same Gas Day.  The deadline for notifying Seller of a reput is 8:00 a.m. to allow for the timely nominations to flow on the next Gas Day.

(i)	Timely Recall Notifications:

(a)	A Releasing Customer recalling capacity should provide notice of such recall to the Seller and the first Replacement Customer no later than 8:00 a.m. on the Day that Timely Nominations are due;
(b)	The Seller should provide notification of such recall to all affected Replacement Customers no later than 9:00 a.m. on the Day that Timely Nominations are due;

(ii)	Early Evening Recall Notifications:

(a)	A Releasing Customer recalling capacity should provide notice of such recall to the Seller and the first Replacement Customer no later than 3:00 p.m. on the Day that Evening Nominations are due;
(b)	The Seller should provide notification of such recall to all affected Replacement Customers no later than 4:00 p.m. on the Day that Evening Nominations are due;

(iii)	Evening Recall Notifications:

(a)	A Releasing Customer recalling capacity should provide notice of such recall to the Seller and the first Replacement Customer no later than 5:00 p.m. on the Day that Evening Nominations are due;
(b)	The Seller should provide notification of such recall to all affected Replacement Customers no later than 6:00 p.m. on the Day that Evening Nominations are due;

(iv)	Intraday 1 Recall Notifications:

(a)	A Releasing Customer recalling capacity should provide notice of such recall to the Seller and the first Replacement Customer no later than 7:00 a.m. on the Day that Intraday 1 Nominations are due;
(b)	The Seller should provide notification of such recall to all affected Replacement Customers no later than 8:00 a.m. on the Day that Intraday 1 Nominations are due; 


(v)	Intraday 2 Recall Notifications:

(a)	A Releasing Customer recalling capacity should provide notice of such recall to the Seller and the first Replacement Customer no later than 12:00 noon on the Day that Intraday 2 Nominations are due;
(b)	The Seller should provide notification of such recall to all affected Replacement Customers no later than 1:00 p.m. on the Day that Intraday 2 Nominations are due; and

(vi)	Intraday 3 Recall Notifications:

(a)	A Releasing Customer recalling capacity should provide notice of such recall to the Seller and the first Replacement Customer no later than 4:00 p.m. on the Day that Intraday 3 Nominations are due;
(b)	The Seller should provide notification of such recall to all affected Replacement Customers no later than 5:00 p.m. on the Day that Intraday 3 Nominations are due.

For recall notification provided to the Seller prior to the recall notification deadline specified above and received between 7:00 a.m. and 5:00 p.m., the Seller should provide notification to all affected Replacement Customers no later than one hour after receipt of such recall notification.  For recall notification provided to the Seller after 5:00 p.m. and prior to 7:00 a.m., the Seller should provide notification to all affected Replacement Customers no later than 8:00 a.m. after receipt of such recall notification.  Releasing Customer may only recall such released capacity that Replacement Customer has not filled.  The Releasing Customer shall make such recall by notifying Seller in writing of such recall and by submitting a nomination change to Seller, pursuant to Section 6.4.1 of the General Terms and Conditions of this Tariff.

In the event of an intraday capacity recall, Seller will determine the allocation of capacity between the Releasing Shipper and the Replacement Shipper(s) based upon the Elapsed Prorata Capacity.  Variations to the use of Elapsed Prorata Capacity may be necessary to reflect the nature of Seller's Tariff, services, and/or operational characteristics.

Seller will not be obligated to deliver in excess of the total daily contract quantity of the release as a result of NAESB WGQ Standard 5.3.55.

The amount of capacity allocated to the Replacement Shipper(s) should equal the original released capacity less the recalled capacity that is adjusted based upon the Elapsed Prorata Capacity or other Seller Tariff specific variations of the Elapsed Prorata Capacity in accordance with NAESB WGQ Standard 5.3.56.

(5)	whether the release is on a permanent or temporary basis;

(6)	the length of time the offer to release should be posted for bidding on Seller's Internet Site;

(7)	whether there are any reput rights;

(8)	and any other conditions or contingencies of the offer to release, including nondiscriminatory provisions necessary to evaluate bids; and the tie breaking criteria, provided, however, that bid evaluation methodologies that are required to be supported by the Seller and provided to Releasing Customers as choices from which they may select and, once chosen, should be used in determining the awards from the bid(s) submitted will be limited to highest rate, net revenue and present value; other choices of bid evaluation methodology can be accorded similar timeline evaluation treatment at the discretion of the Seller; however, the Seller is not required to offer other choices or similar timeline treatment for other choices, nor, is the Seller held to the timeline should the Releasing Customer elect another method of evaluation;

(9)	the legal name of the Replacement Customer that is designated in any Pre-arranged Release ("Designated Replacement Customer"); 

(10)	the bid evaluation method; for index-based capacity release transactions, the Releasing Customer should provide the necessary information and instructions to support the chosen methodology; 

(11)	Volumetric Release - any minimum volumetric commitment.

(12)	An indication of whether the pre-arranged capacity release is to an asset manager as described in Section 5.1.8.1.F, and the asset manager's obligation as to volumetric level and effective time period(s) to deliver gas to, or purchase gas from the Releasing Customer.

(13)	An indication of whether the pre-arranged capacity release is to a marketer participating in a state-regulated retail access program as described in Section 5.1.8.1.F.

6.4.2	(a)	Intraday Nominations.  Any nomination submitted after the Timely Nomination deadline, by eligible Customers, shall be an Intraday Nomination.  An Intraday Nomination shall be effective for one (1) Day only.  Intraday Nominations may be used to nominate new supply or market.  The nomination process set forth in Section 6.4.1(a), above, shall apply to the Intraday Nominations.  An Intraday quantity shall be a revised daily quantity.

(1)	Timetables for Intraday Nominations shall be as follows:

(a)	Evening Nomination Cycle - shall be as follows on the Day before a Service Day, Central Clock Time:

6:00 p.m. Nominations leave control of the service requester;

6:15 p.m. Nominations are received by the Seller (including from TTTSPs); 

6:30 p.m. Seller sends the quick response to the service requester;

8:30 p.m. Seller receives completed confirmations from confirming parties;

9:00 p.m. Seller provides scheduled quantities to the affected service requester and point operator, including bumped parties (notice to bumped parties).

Scheduled quantities resulting from Evening Nominations shall be effective at the start of the next Service Day.

(b)	Intraday 1 Nomination Cycle - shall be as follows on the current Service Day, Central Clock Time:

10:00 a.m. Nominations leave control of the service requester;

10:15 a.m. Nominations are received by the Seller (including from TTTSPs); 

10:30 a.m. Seller sends the quick response to the service requester;

12:30 p.m. Seller receives completed confirmations from confirming parties;

1:00 p.m. Seller provides scheduled quantities to the affected service requester and point operator, including bumped parties (notice to bumped parties).

Scheduled quantities resulting from Intraday 1 Nominations should be effective at 2:00 p.m. on the current Service Day.

(c)	Intraday 2 Nomination Cycle - shall be as follows on the Service Day, Central Clock Time:

2:30 p.m. Nominations leave control of the service requester;

2:45 p.m. Nominations are received by Seller (including from TTTSPs);

3:00 p.m. Seller sends the quick response to the service requester;

5:00 p.m. Seller receives completed confirmations from confirming parties;

5:30 p.m. Seller provides scheduled quantities to the affected service requester and point operator, including bumped parties (notice to bumped parties).

Scheduled quantities resulting from Intraday 2 Nominations shall be effective at 6:00 p.m. on the current Service Day.

(d)	Intraday 3 Nomination Cycle - shall be as follows on the Service Day, Central Clock Time:

7:00 p.m. Nominations leave control of the service requester;

7:15 p.m. Nominations are received by Seller (including from TTTSPs);

7:30 p.m. Seller sends the quick response to the service requester;

9:30 p.m. Seller receives completed confirmations from confirming parties;

10:00 p.m. Seller provides scheduled quantities to the affected service requester and point operator.

Scheduled quantities resulting from Intraday 3 Nominations shall be effective at 10:00 p.m. on the current Service Day.  Bumping is not allowed during the Intraday 3 Nomination Cycle.

(e)	For purposes of Sections 6.4.2(a)(1) above, the word "provides" shall mean, for transmittals pursuant to NAESB WGQ Standards 1.4.x, receipt at the designated site, and for purposes of other forms of transmittal, it shall mean send or post.

An Intraday nomination is subject to Operator's confirmations and Seller's operating conditions.  If Operator confirmation is not received the Intraday nomination will not be accepted.  Seller will not accept a reduced Intraday nomination for any quantity deemed already delivered based on an average hourly flow.

(b)	For purposes of providing notice of any nomination changes to a Customer and or Customer's agent, Seller shall contact either party by telephone or other instant communication device.  With respect to changes initiated by Seller, if a Customer so elects, such Customer may provide a telephone number and Seller will contact Customer at such phone number to alert Customer that a change has been made; provided that where an interruptible Customer's nomination is bumped by a firm Customer's intraday nomination, Seller shall provide notice of such bump to the interruptible Customer in the same manner that Seller uses to notify Customers of OFOs.
